INSERT INTO `config_info` VALUES (1, 'nacos-dev.yml', 'DEV_GROUP', 'server:\r\n  port: 8050\r\nuser:\r\n  name: zhangsan\r\n  age: 30\r\nspring:\r\n  application:\r\n    name: nacosconfig\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        server-addr: 127.0.0.1:8848\r\n       # metadata:\r\n      #    user.name: \"fisher\"\r\n       #   user.password: \"fisher\"\r\n#对外暴露该服务\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n#  endpoint:\r\n#    health:\r\n#      show-details: ALWAYS\r\n#security:\r\n#  enabled: false', 'bbf75c0b0ab78874b990148005c6afe5', '2019-05-14 20:10:16', '2019-05-16 11:30:05', NULL, '10.0.0.113', 'dev', '', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (16, 'gexin-zipkin-dev.yml', 'DEV_GROUP', 'server:\r\n  port: 8054\r\nspring:\r\n  application:\r\n    name: zipkin\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        server-addr: 127.0.0.1:8848\r\n       # metadata:\r\n      #    user.name: \"fisher\"\r\n       #   user.password: \"fisher\"\r\nmanagement:\r\n  #对外暴露该服务\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n security: \r\n  enabled: false #关闭验证\r\ninfo: #/info请求的显示信息\r\n app: \r\n  name: ${spring.application.name}\r\n  version: 1.0.0\r\n build: \r\n  artifactId: @project.artifactId@\r\n  version: @project.version@', '0bbaf678669d8b7cd305aa3323238c37', '2019-05-16 17:23:27', '2019-05-16 17:31:34', NULL, '10.0.0.113', '', '626f39e6-82b7-4f1a-9079-f51624141bfe', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (23, 'gexin-demo-dev.yml', 'DEV_GROUP', 'server:\r\n  port: 8051\r\nuser:\r\n  name: zhangsan1111\r\n  age: 30\r\nspring:\r\n  application:\r\n    name: gexindemo\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        server-addr: 127.0.0.1:8848\r\n#对外暴露该服务\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'', '388930778fc28689c356163dfd65c3d5', '2019-05-17 16:18:56', '2019-05-17 16:18:56', NULL, '10.0.0.113', '', '626f39e6-82b7-4f1a-9079-f51624141bfe', NULL, NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (24, 'gexin-gateway-dev.yml', 'DEV_GROUP', 'server:\r\n  port: 8052\r\nuser:\r\n  name: zhangsan1111\r\n  age: 30\r\nspring:\r\n  application:\r\n    name: gexingateway\r\n  cloud:\r\n    nacos:\r\n      discovery:\r\n        server-addr: 127.0.0.1:8848\r\n       # metadata:\r\n      #    user.name: \"fisher\"\r\n       #   user.password: \"fisher\"\r\n    # 路由到其他服务,url需要用[lb://]+[serviceId]\r\n    gateway:\r\n      #可以根据请求参数,cookie,host,请求时间,请求头等进行校验判断路由, 下面根据先后顺序转发\r\n      routes:\r\n      - id: gexinnacos\r\n        # 必须使用http进行转发 lb代表从注册中心获取服务\r\n        uri: lb://gexinnacos\r\n        predicates:\r\n          #转发的路径\r\n        - Path=/gexinnacos/**\r\n        filters:\r\n          # http://10.0.0.113:8052/gexinnacos/test/test, 必须加上StripPrefix=1，否则访问服务时会带上nacosconfig\r\n          #而不是我们期望的去掉nacosconfig，只保留**部分\r\n        - StripPrefix=1\r\n      discovery:\r\n        locator:\r\n          enabled: true\r\n#对外暴露该服务\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n#  endpoint:\r\n#    health:\r\n#      show-details: ALWAYS\r\nsecurity:\r\n  enabled: false', 'ac9ad1de13577c356029c175fe815faa', '2019-05-17 16:23:42', '2019-05-17 18:29:11', NULL, '10.0.0.113', '', '626f39e6-82b7-4f1a-9079-f51624141bfe', '', NULL, NULL, 'yaml', NULL);
